import React from 'react';
import { Link } from 'react-router-dom';
import '../footer.css';

export default function Footer() {
  return (
    <footer className="site-footer">
      <div className="footer-inner">
        <div className="footer-links">
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/projects">Projects</Link>
          <Link to="/contact">Contact</Link>
        </div>

        <div className="socials">
          <a href="#" aria-label="github" className="social">GH</a>
          <a href="#" aria-label="linkedin" className="social">LI</a>
          <a href="#" aria-label="twitter" className="social">TW</a>
        </div>

        <div className="copyright">Â© {new Date().getFullYear()} GOWTHAM C. All rights reserved.</div>
      </div>
    </footer>
  );
}
